import styled from 'styled-components';

export const Container = styled.div`
  background: #ECECEC;
`;
export const Wrapper = styled.div`
    width:100%;
    max-width:100%;
    margin:0 auto;
    float:none;
    background: #fff;
    border-right: 1px solid rgba(98, 87, 163, 0.3);
    border-left: 1px solid rgba(98, 87, 163, 0.3);
    height:100vh;
    overflow:hidden;
    position: relative;
    .types--container{
      width:200px;
      float:left;
      label {
        width: 100%;
        display: block;
        padding-bottom: 13px;
      }
    }
`;
